import React from "react";
import "../css/header.css";

const Header = () => (
  <div className="hero_header">
    <div className="container">
      <div className="text">
        <p>
          Hei <br />
          Jeg heter
        </p>
        <h1>Maryna Serheieva</h1>
        <hr />
        <p>og jeg er utvikler</p>
      </div>
    </div>
  </div>
);

export default Header;
